import React, { Component } from "react";
import Layout from "../components/mapLayout";

export class map extends Component {
  render() {
    return (
      <Layout>
        <div className="container-fluid conMap h-100">
          <div className="row align-items-center h-100">
            <div className="col-lg-6 colLeft">
              <div className="form-inline">
                 
                <p className="pPick">  <img src = "Image/mapgps.svg" className = "img-fluid" style = {{marginRight: "10px"}}></img>Pick Up Location</p>
              </div>
              <p className="pPick-up">
                4232 Peachtree Battle Avenue, Urdaneta, Makati City
              </p>
              <p className="pPick" style={{ marginTop: "30px" }}>
                Drop Off Location
              </p>
              <p className="pDrop-off">
                Discovery Primea, Urdaneta, Makati City
              </p>
              <p className="pNote">Note: Delivery only within Metro Manila</p>
            </div>
          </div>
        </div>
      </Layout>
    );
  }
}

export default map;
